import * as React from 'react';
import { styled } from '@mui/material/styles';
import './About.css'
import Avatar from '@mui/material/Avatar';
import Grid from '@mui/material/Unstable_Grid2';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Author from './about/avatar/Author'
import PropTypes from 'prop-types';
import AppBar from '@mui/material/AppBar';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';
import Button from '@mui/material/Button';


const Div = styled('div')(({ theme }) => ({

    ...theme.typography.button,
    fontSize: "3em",
    fontFamily: "'Source Sans Pro', 'sans-serif'"

}));

const Dive = styled('div')(({ theme }) => ({

    ...theme.typography.button,
    fontSize: "1em",
    fontFamily: "'Source Sans Pro', 'sans-serif'"
}));

const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
}));

const Content = styled.div`
  margin: auto;
  max-width: 500px;
`;

const GreenAvatar = styled(Avatar)`
  background-color: green;
`;

const BlueAvatar = styled(Avatar)`
  background-color: blue;
`;

const OrangeAvatar = styled(Avatar)`
  background-color: orange;
`;

const BorderedAvatar = styled(Avatar)`
  border: 3px solid lightseagreen;
`;

const AvatarContainer = styled.div`
  display: flex;
  margin-bottom: 14px;
  & > * {
    margin: 4px;
  }
`;

const SizedAvatar = styled(Avatar)`
  ${({ size, theme }) => `
    width: ${theme.spacing(size)}px; 
    height: ${theme.spacing(size)}px; 
  `};
`;

function ImageAvatars() {
    return (
        <AvatarContainer>
            <Avatar
                alt="Jack Sparrow"
                src="https://images.pexels.com/photos/4016173/pexels-photo-4016173.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            />
            <Avatar
                alt="Mike Wazowski"
                src="https://images.pexels.com/photos/6386956/pexels-photo-6386956.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            />
            <Avatar
                alt="Evelyn Carnahan"
                src="https://images.pexels.com/photos/1722198/pexels-photo-1722198.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            />
        </AvatarContainer>
    );
}

function LetterAvatars() {
    return (
        <AvatarContainer>
            <Avatar>Da</Avatar>
            <Avatar>W</Avatar>
            <Avatar>G</Avatar>
        </AvatarContainer>
    );
}

const AvatarLabel = styled.div`
  display: flex;
  align-items: center;
`;

function AvatarWithText() {
    return (
        <AvatarContainer>
            <AvatarLabel>
                <Avatar
                    style={{ marginRight: "14px", zIndex: 100 }}
                    alt="Jack Sparrow"
                    src="https://images.pexels.com/photos/6386956/pexels-photo-6386956.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                />
                <Typography variant="body2"> Jack Sparrow</Typography>
            </AvatarLabel>
        </AvatarContainer>
    );
}

function ColoredAvatars() {
    return (
        <AvatarContainer>
            <GreenAvatar>G</GreenAvatar>
            <BlueAvatar>B</BlueAvatar>
            <OrangeAvatar>O</OrangeAvatar>
        </AvatarContainer>
    );
}

function BorderedAvatars() {
    return (
        <AvatarContainer>
            <BorderedAvatar
                alt="Jack Sparrow"
                src="https://images.pexels.com/photos/4016173/pexels-photo-4016173.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            />
            <BorderedAvatar
                alt="Mike Wazowski"
                src="https://images.pexels.com/photos/6386956/pexels-photo-6386956.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            />
            <BorderedAvatar
                alt="Evelyn Carnahan"
                src="https://images.pexels.com/photos/1722198/pexels-photo-1722198.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            />
        </AvatarContainer>
    );
}

function AvatarButton() {
    return (
        <IconButton onClick={() => console.log("hi")}>
            <Avatar>C</Avatar>
        </IconButton>
    );
}

function FallbackAvatars() {
    return (
        <AvatarContainer>
            <Typography>
                If broken image, uses children, then first letter of alt, then generic
                avatar image
            </Typography>
            <Avatar alt="Jack Sparrow" src="/broken-image.jpg">
                B
            </Avatar>
            <Avatar alt="Jack Sparrow" src="/broken-image.jpg" />
            <Avatar src="/broken-image.jpg" />
        </AvatarContainer>
    );
}


function SizedAvatars() {
    return (
        <AvatarContainer>
            <SizedAvatar
                size={4}
                alt="Jack Sparrow"
                src="https://images.pexels.com/photos/6386956/pexels-photo-6386956.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            >
                G
            </SizedAvatar>
            <SizedAvatar
                size={6}
                alt="Mike Wazowski"
                src="https://images.pexels.com/photos/1722198/pexels-photo-1722198.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            >
                B
            </SizedAvatar>
            <SizedAvatar
                size={16}
                alt="Evelyn Carnahan"
                src="https://images.pexels.com/photos/4016173/pexels-photo-4016173.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            >
                O
            </SizedAvatar>
        </AvatarContainer>
    );
}

function About() {

    return (
        <Box sx={{ width: '100%' }}>
            <Grid container spacing={2} columns={16}>
                <Grid xs={8}>
                    <Typography variant="h5"> Avatar with Text </Typography>
                    <AvatarWithText />
                </Grid>
                <Grid xs={8}>
                    <div className="author" >
                        <Avatar style={{ width: "350px", height: "350px" }} src="https://i.ibb.co/xjN2hV1/IMG-8436.jpg" />
                    </div>
                </Grid>
            </Grid>

        </Box>
    );
}
export default About;
